import requests
import websocket
import json

# find the assay id for a specific assay
def flapjack_get_assay_id_request(assay_name, access_token):
    flapjack_request_assay_id_url = "http://3.128.232.8:8000/api/assay/?search=" + assay_name
    headers = {
        'Authorization': 'Bearer ' + access_token}
    return requests.get(flapjack_request_assay_id_url, headers=headers)


# get the samples associated for a specific assay
def flapjack_get_samples_for_assay_request(assay_id, access_token):
    flapjack_request_samples_url = "http://3.128.232.8:8000/api/sample/?assay=" + str(assay_id)
    headers = {
        'Authorization': 'Bearer ' + access_token}
    return requests.get(flapjack_request_samples_url, headers=headers)


# get all the measurements for a sample associated for a specific assay
def flapjack_get_measurements_for_sample_request(sample_id, access_token):
    flapjack_request_measurements_url = "http://3.128.232.8:8000/api/measurement/?sample=" + str(sample_id)
    headers = {
        'Authorization': 'Bearer ' + access_token}
    return requests.get(flapjack_request_measurements_url, headers=headers)

# get all the signal info for a specific id
def flapjack_get_signal_request(signal_id, access_token):
    flapjack_request_signals_url = "http://flapjack.rudge-lab.org:8000/api/signal/?id=" + str(signal_id)
    headers = {
        'Authorization': 'Bearer ' + access_token}
    return requests.get(flapjack_request_signals_url, headers=headers)

